userDefinedLinkHintCss:
div > .vimiumHintMarker {
  border: 0;
  box-shadow: none;
  background: transparent;
}

div > .vimiumHintMarker span {
  font-size: 14px;
  font-weight: normal;
  color: white;
  text-shadow: -1px  1px black,
                1px  1px black,
                1px -1px black,
               -1px -1px black,
                0px  1px black,
                1px  0px black,
                0px -1px black,
               -1px  0px black;
}

div > .vimiumHintMarker > .matchingCharacter {
  font-size: 14px;
  font-weight: normal;
  color: black;
}
